import styles from './Footer.module.css'

const Footer = () => {
  return (
    <footer className={styles.footer}>
      <div>
        <h3>Cadastre-se e salve vidas</h3>
        <p>© 2022 · AjudA+ - Todos os direitos reservados</p>
      </div>
    </footer>
  )
}

export default Footer
